import React from "react";
import { useParams } from 'react-router-dom'

function RepoList (){
    let { username } = useParams()

    React.useEffect(() => {
        let Status = 0;
        let Message = "";
        let url = "https://api.github.com/users/jserv/repos"
        let res = fetch(url, {
        method: "GET",
        headers: {
            "Content-type": "application/json",
        }
        })
        .then((res) => {
            Status = res.status;
            return res.json();
        })
        .catch((error) => {
            Message = "Something Wrong";
        });
    })

    return (
        <h1>
            Repository for { username }
        </h1>

    );
}


export default RepoList;
